import React from 'react';
import Member from './members/Member';

function Teammember() {
  return (
      <div className=''>
            <div className='navbar bg-dark text-white'>
                <h1>Our Member</h1>
            </div>
            <div className='row mx-md-n5'>
                <Member name = 'Hesham'/>
                <Member name = 'Abeer'/>
                <Member name = 'Aseel'/>
                <Member name = 'Haytham'/>
            </div>
      </div>
  )
}

export default Teammember;
